import React from "react";
import { AiFillBank, AiFillFacebook, AiFillGithub, AiFillInstagram, AiFillTwitterCircle } from "react-icons/ai";

function Footer() {
  return (
    <div className="bg-basecolor px-10 py-5 lg:grid lg:grid-cols-4">
      <div>
        <h1 className="text-primary">React App</h1>
        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Explicabo tempora dignissimos facilis ullam vitae excepturi, in quo fugiat est repellat.</p>
        <div className="flex">
          <AiFillInstagram></AiFillInstagram>
          <AiFillFacebook></AiFillFacebook>
          <AiFillTwitterCircle></AiFillTwitterCircle>
          <AiFillGithub></AiFillGithub>
          <AiFillBank></AiFillBank>
        </div>
      </div>
    </div>
  );
}

export default Footer;
